import Form from '../Form/Form.js';
import Button from '../Button/Button.js';
import './login.css';
import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';


function Login() {

    var fields = {};
    const input_field =
    {
        name: '',
        email: '',
        password: '',


    };
    const form_field =
    {
        name: '',
        id: '',
        type: ''



    }
    var id = useParams();
    console.error(id);
   

    if (id = '/Register') {
        fields = {
           'name':{ name: 'name', id: 'name', type: 'text', value: input_field.name },
           'email':{ name: 'email', id: 'email', type: 'email', value: input_field.email },
            'password':{ name: 'password', id: 'password', type: 'password', value: input_field.password },

        };
    }
    else if (id = '/Login') {
        fields = {

           'name': { name: 'email', id: 'email', type: 'email', value: input_field.email },
            'password':{ name: 'password', id: 'password', type: 'password', value: input_field.password },

        };



    }
    else 
    {
        fields = [];
        console.error('Invalid route');
    }




    return (

        <Form fields />


    )


}



export default Login;
